import{_ as r,o as t,c as e,R as o}from"./chunks/framework.vB1haF5z.js";const C=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"docs/协议/待学习的.md","filePath":"docs/协议/待学习的.md"}'),c={name:"docs/协议/待学习的.md"},f=o('<p>RFC 793 - Transmission Control Protocol 这是定义TCP的第一个正式标准文档，由Vint Cerf编写，发布于1981年。 地址: <a href="https://www.rfc-editor.org/rfc/rfc793" target="_blank" rel="noreferrer">https://www.rfc-editor.org/rfc/rfc793</a> RFC 1122 - Requirements for Internet Hosts -- Communication Layers 这个文档详细说明了TCP/IP栈中各层的要求，包括TCP层。 地址: <a href="https://www.rfc-editor.org/rfc/rfc1122" target="_blank" rel="noreferrer">https://www.rfc-editor.org/rfc/rfc1122</a> RFC 5681 - TCP Congestion Control 描述了TCP拥塞控制机制的更新和改进。 地址: <a href="https://www.rfc-editor.org/rfc/rfc5681" target="_blank" rel="noreferrer">https://www.rfc-editor.org/rfc/rfc5681</a> RFC 6582 - The TCP Congestion Control Algorithm 提供了一个通用框架来描述TCP拥塞控制算法。 地址: <a href="https://www.rfc-editor.org/rfc/rfc6582" target="_blank" rel="noreferrer">https://www.rfc-editor.org/rfc/rfc6582</a> RFC 796 - Transmission Control Protocol - Formal Specification 提供了一个形式化的TCP规范。 地址: <a href="https://www.rfc-editor.org/rfc/rfc796" target="_blank" rel="noreferrer">https://www.rfc-editor.org/rfc/rfc796</a> RFC 854 - Telnet Protocol Specification 虽然不是直接关于TCP本身，但Telnet协议使用TCP作为其传输层协议，对于理解TCP的应用很有帮助。 地址: <a href="https://www.rfc-editor.org/rfc/rfc854" target="_blank" rel="noreferrer">https://www.rfc-editor.org/rfc/rfc854</a></p>',1),a=[f];function n(s,i,_,w,l,d){return t(),e("div",null,a)}const h=r(c,[["render",n]]);export{C as __pageData,h as default};
